import axios from "axios";

const accessToken = sessionStorage.getItem("accessToken");

async function createNewInvoice(invoiceState, lineItemState) {
  console.log(invoiceState, lineItemState);
  console.log(accessToken);
  const { projectDescription } = invoiceState;
  console.log("this is line 9 ", projectDescription);

  const apiURL = "http://localhost:4082/api";

  const authAxios = axios.create({
    baseURL: apiURL,
    headers: {
      Authorization: `Bearer ${accessToken}`,
    },
  });

  try {
    const res = await authAxios.post("/invoice");
    console.log(res.data);
  } catch (error) {
    console.log(error);
    return;
  }
}

export default createNewInvoice;
